import { GoogleLogin } from 'react-google-login'
import axios from 'axios'

function GoogleCalendar() {

  const responseGoogle = response => {
    console.log(response);
    console.log("wwww");
    const { code } = response;
    axios.post('/api/create-tokens', { code })
      .then(response => {
        console.log(response.data);
      })
      .catch(error => console.log(error.message));

  }

  const responseError = (error) => {
    console.log("sss");
    console.log(error);
  }

  const handleSubmit = (e) =>  {
    e.preventDefault();
  }

  const [summary, setSummary] = useState('');
  const [description, setDescription] = useState('');
  const [location, setLocation] = useState('');
  const [endDateTime, setEndDateTime] = useState('');

  return (
    <>
      <div>
        <h1>Google Calendar</h1>
        <p>This is the Google Calendar page</p>
      </div>
      <div>
        <GoogleLogin
          clientId='586680212360-rtc6o4nre05vi4fl9v53iuq2cdng1ai9.apps.googleusercontent.com'
          buttonText="sign in and authorize calendar"
          onSuccess={responseGoogle}
          onFailure={responseError}
          cookiePolicy={'single_host_origin'}
          responseType='code'
          accessType='online'
          scope='openid email profile https://www.googleapis.com/auth/calendar'
        />
      </div>
      <div>
        <form onSubmit={handleSubmit}>
          <label htmlfor="summary"></label>
          <br></br>
          <input type="text" id="summary" value={summary} onchange={e => setSummary(e.target.value)}></input>
          <label htmlfor="description"></label>
          <br></br>
          <input type="text" id="summary" value={description} onchange={e => setDescription(e.target.value)}></input>
          <label htmlfor="location"></label>
          <br></br>
          <input type="text" id="summary" value={location} onchange={e => setLocation(e.target.value)}></input>
          <label htmlfor="endDateTime"></label>
          <br></br>
          <input type="text" id="summary" value={endDateTime} onchange={e => setEndDateTime(e.target.value)}></input>
        </form>
      </div>
    </>
  )
}

export default GoogleCalendar;
